import "../styles/hero.scss";
import { motion } from "framer-motion";

const Hero = () => {
  return (
    <div className="hero">
      <div className="hero__text">
        <motion.h1 initial={{ y: "50vh" }} animate={{ y: 0 }}>
          Hi, Welcome to My Recipe Book
        </motion.h1>
      </div>
    </div>
  );
};

export default Hero;
